import React from 'react';
import Box from '@material-ui/core/Box';

const SlideWindow = ({ color, slideData }) => {
    return (
        <Box
            style={{
                backgroundColor: color,
                width: '848px',
                height: '480px',
                alignSelf: 'center',
                marginTop: '10px',
                position: 'relative'
            }}
        >
            <div>
                {slideData && (
                    <div style={{ alignItems: 'center' }}>
                        <p>{slideData.slide_name}</p>
                        <h2 style={{ alignContent: 'center' }}>{slideData.header}</h2>
                        <p>{slideData.body}</p>
                    </div>
                )}
            </div>

        </Box>
    );
};

